import React from 'react';
import ReactDOM from 'react-dom';

let currDate = new Date();
let time = currDate.getHours();
let mrng = "";

if(time >= 1 && time <= 11){
  mrng = "Good Morning";
}

if(time >= 12 && time <= 19){
  mrng = "Good AfterNoon";
}

if(time >= 20 && time <= 24){
   mrng = "Good Night";
}


ReactDOM.render(
  <>
    <h1> Hello Sir , {mrng} </h1>

  </>,
  document.getElementById('root')
);
